script:
frankieRuntime = {
	Survey : {
		relevance_map: function(state) {return {G1: state.G1.relevance,Q1: state.Q1.relevance,Q2: state.Q2.relevance,Q3: state.Q3.relevance,Q4: state.Q4.relevance,G2: state.G2.relevance,Q13: state.Q13.relevance,Q14: state.Q14.relevance,Q15: state.Q15.relevance,Q16: state.Q16.relevance,G3: state.G3.relevance,Q17: state.Q17.relevance,Q18: state.Q18.relevance,Q19: state.Q19.relevance,G5: state.G5.relevance,Q20: state.Q20.relevance,Q21: state.Q21.relevance,G6: state.G6.relevance,Q22: state.Q22.relevance,G7: state.G7.relevance,Q23: state.Q23.relevance,G4: state.G4.relevance,Q12: state.Q12.relevance};},
		has_previous: function(state) {return (function(){if(!state.Survey.before_navigation||!state.Survey.relevance_map){return false;}for(var i=0;i<state.Survey.before_navigation.length;i++){if(state.Survey.relevance_map[state.Survey.before_navigation[i]]){return true}}return false;})();},
		has_next: function(state) {return (function(){if(!state.Survey.after_navigation||!state.Survey.relevance_map){return false;}for(var i=0;i<state.Survey.after_navigation.length;i++){if(state.Survey.relevance_map[state.Survey.after_navigation[i]]){return true}}return false;})();},
		validity: function(state) {return (!state.G1.in_current_navigation || state.G1.validity) && (!state.G2.in_current_navigation || state.G2.validity) && (!state.G3.in_current_navigation || state.G3.validity) && (!state.G5.in_current_navigation || state.G5.validity) && (!state.G6.in_current_navigation || state.G6.validity) && (!state.G7.in_current_navigation || state.G7.validity) && (!state.G4.in_current_navigation || state.G4.validity);},
		validity_map: function(state) {return {G1: state.G1.validity,Q1: state.Q1.validity,Q2: state.Q2.validity,Q3: state.Q3.validity,Q4: state.Q4.validity,G2: state.G2.validity,Q13: state.Q13.validity,Q14: state.Q14.validity,Q15: state.Q15.validity,Q16: state.Q16.validity,G3: state.G3.validity,Q17: state.Q17.validity,Q18: state.Q18.validity,Q19: state.Q19.validity,G5: state.G5.validity,Q20: state.Q20.validity,Q21: state.Q21.validity,G6: state.G6.validity,Q22: state.Q22.validity,G7: state.G7.validity,Q23: state.Q23.validity,G4: state.G4.validity,Q12: state.Q12.validity};}
	},
	G1 : {
		validity: function(state) {return (!state.Q1.in_current_navigation || state.Q1.validity) && (!state.Q2.in_current_navigation || state.Q2.validity) && (!state.Q3.in_current_navigation || state.Q3.validity) && (!state.Q4.in_current_navigation || state.Q4.validity);}
	},
	Q1 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q1.value);},
		validation_min_char_length: function(state) {return FrankieScripts.isNotVoid(state.Q1.value) && state.Q1.value.length < 2;},
		validation_max_char_length: function(state) {return FrankieScripts.isNotVoid(state.Q1.value) && state.Q1.value.length > 30;},
		validity: function(state) {return (!state.Q1.validation_required && !state.Q1.validation_min_char_length && !state.Q1.validation_max_char_length && !state.Q1.validation_pattern);},
		validation_pattern: function(state) {return FrankieScripts.isNotVoid(state.Q1.value) && !RegExp("^[A-Za-z][-\.A-Za-z ]+$").test(state.Q1.value);}
	},
	Q2 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q2.value);},
		validation_between: function(state) {return FrankieScripts.isNotVoid(state.Q2.value) && (state.Q2.value < 25 || state.Q2.value > 180);},
		validity: function(state) {return (!state.Q2.validation_required && !state.Q2.validation_between);}
	},
	Q3 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q3.value);},
		validity: function(state) {return (!state.Q3.validation_required && !state.Q3.validation_max_char_length && !state.Q3.validation_pattern_email);},
		validation_max_char_length: function(state) {return FrankieScripts.isNotVoid(state.Q3.value) && state.Q3.value.length > 25;},
		validation_pattern_email: function(state) {return FrankieScripts.isNotVoid(state.Q3.value) &&  !/^\w+@[a-zA-Z_]+?\.[a-zA-Z]{2,3}$/.test(state.Q3.value);}
	},
	Q4 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q4.value);},
		validation_max_word_count: function(state) {return FrankieScripts.isNotVoid(state.Q4.value) &&  FrankieScripts.wordCount(state.Q4.value) > 500;},
		validation_min_word_count: function(state) {return FrankieScripts.isNotVoid(state.Q4.value) &&  FrankieScripts.wordCount(state.Q4.value) < 10;},
		validity: function(state) {return (!state.Q4.validation_required && !state.Q4.validation_max_word_count && !state.Q4.validation_min_word_count);}
	},
	G2 : {
		validity: function(state) {return (!state.Q13.in_current_navigation || state.Q13.validity) && (!state.Q14.in_current_navigation || state.Q14.validity) && (!state.Q15.in_current_navigation || state.Q15.validity) && (!state.Q16.in_current_navigation || state.Q16.validity);}
	},
	Q13 : {
		masked_value: function(state) {return state.Q13.value ? {A1: state.Q13A1.label,A2: state.Q13A2.label,A3: state.Q13A3.label,Aother: state.Q13AotherAtext.value}[state.Q13.value] : '';},
		validity: function(state) {return !state.Q13.validation_required;},
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q13.value);}
	},
	Q13AotherAtext : {
		conditional_relevance: function(state) {return state.Q13.value === 'Aother';},
		relevance: function(state) {return state.Q13AotherAtext.conditional_relevance;}
	},
	Q14 : {
		validity: function(state) {return !state.Q14.validation_required;},
		validation_required: function(state) {return [state.Q14A1.value,state.Q14A2.value,state.Q14A3.value].filter(Boolean).length  < 3;}
	},
	Q14A1 : {
		masked_value: function(state) {return state.Q14A1.value ? {Ac1: state.Q14Ac1.label,Ac2: state.Q14Ac2.label,Ac3: state.Q14Ac3.label}[state.Q14A1.value] : '';}
	},
	Q14A2 : {
		masked_value: function(state) {return state.Q14A2.value ? {Ac1: state.Q14Ac1.label,Ac2: state.Q14Ac2.label,Ac3: state.Q14Ac3.label}[state.Q14A2.value] : '';}
	},
	Q14A3 : {
		masked_value: function(state) {return state.Q14A3.value ? {Ac1: state.Q14Ac1.label,Ac2: state.Q14Ac2.label,Ac3: state.Q14Ac3.label}[state.Q14A3.value] : '';}
	},
	Q15 : {
		masked_value: function(state) {return FrankieScripts.listStrings([{ value:state.Q15A1.value, label:state.Q15A1.label }, { value:state.Q15A2.value, label:state.Q15A2.label }, { value:state.Q15A3.value, label:state.Q15A3.label }, { value:state.Q15A4.value, label:state.Q15A4.label }, { value:state.Q15Aother.value, label:state.Q15AotherAtext.value }].filter(function(elem){return elem.value}).map(function(elem){return elem.label}), state.Survey.lang);},
		validity: function(state) {return !state.Q15.validation_min_option_count;},
		validation_min_option_count: function(state) {return [state.Q15A1.value,state.Q15A2.value,state.Q15A3.value,state.Q15A4.value,state.Q15Aother.value].filter(Boolean).length < 1;}
	},
	Q15AotherAtext : {
		conditional_relevance: function(state) {return state.Q15Aother.value === true;},
		relevance: function(state) {return state.Q15AotherAtext.conditional_relevance;}
	},
	Q16 : {
		validity: function(state) {return !state.Q16.validation_required;},
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q16.value);}
	},
	G3 : {
		validity: function(state) {return (!state.Q17.in_current_navigation || state.Q17.validity) && (!state.Q18.in_current_navigation || state.Q18.validity) && (!state.Q19.in_current_navigation || state.Q19.validity);}
	},
	Q17 : {
		masked_value: function(state) {return FrankieScripts.formatSqlDate(state.Q17.value, "YYYY/MM/DD");},
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q17.value);},
		validity: function(state) {return !state.Q17.validation_required;}
	},
	Q18 : {
		masked_value: function(state) {return FrankieScripts.formatSqlDate(state.Q18.value, "YYYY/MM/DD") + " " + FrankieScripts.formatTime(state.Q18.value, false);},
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q18.value);},
		validity: function(state) {return !state.Q18.validation_required;}
	},
	Q19 : {
		masked_value: function(state) {return FrankieScripts.formatTime(state.Q19.value, false);},
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q19.value);},
		validity: function(state) {return !state.Q19.validation_required;}
	},
	G5 : {
		validity: function(state) {return (!state.Q20.in_current_navigation || state.Q20.validity) && (!state.Q21.in_current_navigation || state.Q21.validity);}
	},
	Q20 : {
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q20.value) || !state.Q20.value.size || !state.Q20.value.stored_filename;},
		validity: function(state) {return !state.Q20.validation_required;}
	},
	Q21 : {
		validity: function(state) {return !state.Q21.validation_required;},
		validation_required: function(state) {return FrankieScripts.isVoid(state.Q21.value) || !state.Q21.value.size || !state.Q21.value.stored_filename;}
	},
	G6 : {
		validity: function(state) {return (!state.Q22.in_current_navigation || state.Q22.validity);}
	},
	G7 : {
		validity: function(state) {return (!state.Q23.in_current_navigation || state.Q23.validity);}
	},

}
